import React, { Component } from 'react';
import "./fontawesome"
import Navbar from './navbar'
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom'
 import App from './App'
import Details from './details'
// import SideNav from './sidenav'
import Autocomplete from './components/Autocomplete';
import store from './store'
import {Provider} from 'react-redux'
import queryString from 'query-string'
import Suggestions from "./suggestions"
import {CookiesProvider} from 'react-cookie'
import Subcats from './subcats';
import axios from 'axios';
class Category extends Component {
    constructor(props) {
        super(props);
        this.state = { 
            sub: []
         }
    }
    componentDidMount =()=>{
      
    }
    
    render() { 
        return (
            <CookiesProvider>
            <div>
                <Router>
                 <Provider store={store}>
                 <Navbar />
                 <div className="row">
                     <div className="col-3"></div>
                      <div className="col-6">
                 <center>
                 <div style={{position:"absolute",backgroundColor:"white", top:"0px",width:"50%", zIndex:"2"}}>
                     <Route path='/product/:id' component={Suggestions} />
                 </div> 
                 </center>     
                      </div>
                 </div>
                       
                 <br/>
                 <Route path='/' exact component={Subcats} />
                 <div> 
                 <Switch> 
                 <Route path='/product/:id' exact   component={Details} />  
                 <Route path='/:category' exact   component={App} />                                       
                 </Switch>          
                 </div>
                
                
                     </Provider>
                </Router>
            </div>
            </CookiesProvider>
         );
    }
}

export default Category;
